import React from "react";
import "./Timer.css";

export default function Timer(props) {
return (
	<div id={props.index} className="timer">
		<span className="digits">
			{props.index}{("0" + Math.floor(((props.countdown - props.time) / 60000) % 60)).slice(-2)}:
		</span>
		<span className="digits">
			{("0" + Math.floor(((props.countdown - props.time) / 1000) % 60)).slice(-2)}.
		</span>
		<span className="digits mili-sec">
			{("0" + (((props.countdown - props.time) / 10) % 100)).slice(-2)}
		</span>
	</div>
);
}
